const News = () => {
    return <div>
        <Header />
 <div className={s.navigation} >
<div>  <form>
    <input type="text" placeholder="Введите запрос"  />
    <button type="submit">Поиск</button>

</form></div>
<div></div>
<div>   <button type="submit">Добавить новость</button> </div>


 </div>
   <Banner />

    </div>
}

export default News;
